My Sisters Hot Friend - Amy Brooke
Added: February 24, 2011

Bill has come home and spies his kid sister's best friend Amy primping and preening in front of the mirror. She just got her new fake boobs and she is obviously excited and happy about them, because she is pushing them up, grabbing them, and showing them off to herself. Bill doesn't want to stop the show, and just stays quiet while she puts on her little show. He finally reveals himself to her, and she is shocked that he would intrude on her private space. He just wants to feel them for himself, and then they get carried away right there in the bathroom!
